function winner(props) {
    return (
        <tr>
            <td>{props.address}</td>
            <td>{props.fee}</td>
            <td>{props.entrance_date}</td>
            <td>{props.won}</td>
            <td>{props.date}</td>
        </tr>
    );
}

export default winner;
